	# dr/dt
	du[1] = o117*pr+o119*pr-2*G*o104*o105*o114*o129*o61*o8*pr-4*G*o104*o105*o106*o111*(2*pr+o103*o117*pr+o119*o60*pr)

	# dtheta / dt
	du[2] = o117*o44*o54*ptheta+o119*o44*o54*ptheta-2*G*o114*o129*o147*o152*o61*o8*ptheta-4*G*o104*o105*o106*o111*(2*o44*o54*ptheta+o103*o117*o44*o54*ptheta+o119*o44*o54*o60*ptheta)

	# dpr / dt
	du[3] = o117*o147*o35*o54+o119*o147*o35*o54+4*G*o104*o105*o106*o111*(-2*o147*o35*o54-o103*o117*o147*o35*o54-o119*o147*o35*o54*o60)+G*o105*o106*o114*o44*o61*o8-2*G*o114*o129*o152*o35*o61*o8*(r^-4)

	# dptheta / dt (conservation of angular momentum holds)
	du[4] = 0

	# EOB hamiltonian
	u[5] = o103+o60+G*o104*o105*o106*o114*o61*o8
end


